int majorityElement(std::vector<int> &nums)
{
	int n =nums.size();
	int can = nums[0];
	int count = 1;
	if(n<=2)
		return can;
	for(int i=1; i<n;i++)
	{
		if(nums[i] == can)
			count++;
		else
			count--;
		if(count == 0)
		{
			can = nums[i];
			count = 1;
		}
	}
	return can;
}


